import axios from 'axios';
import React, { useEffect, useState } from 'react'
import { Link, useParams } from 'react-router-dom'

function Read() {
    const {id} = useParams();
    const [user, setUser] = useState([])
    useEffect(()=> {
        axios.get('http://localhost:8081/read/'+id)
        .then(res =>{
            console.log(res);
            setUser(res.data);
        })
        .catch(err => console.log(err))
    }, [])
  return (
    <div>
        <div>
            <h2>User Data</h2>
            <h2>{user.ID}</h2>
            <h2>{user.usuario}</h2>
            <h2>{user.password}</h2>
            <Link to='/'> back</Link>
        </div>
    </div>
  )
}

export default Read
